import logo from './logo.svg';
import './App.css';

const searchBar = (props)=>{
  return(
    <>
      <h1>Name: {props.name}</h1>
    </>
  )
}

function App() {
  return (
    <div className="App">
      <searchBar name="Harry"/>
    </div>
  );
}

export default App;
